                        }
                    }
                }
                if (isEdge) {
                    board[i][j] = 'D';
                }
            }
        }
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (board[i][j] == 'D') {
                    dfs(board, i, j);
                }
            }
        }
        return board;
