        int m = board.length, n = board[0].length;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (board[i][j].equals("a")) continue;
                boolean flag = true;
                for (int k = -1; k <= 1; k++) {
                    for (int l = -1; l <= 1; l++) {
                        if (!(k == 0 && l == 0)) {
                            if (i + k >= 0 && i + k < m && j + l >= 0 && j + l < n &&!board[i+k][j+l].equals("a") && board[i+k][j+l].equals(board[i][j])) {
