        int m = board.length, n = board[0].length;
        boolean hasO = false;
        for (int i = 0; i < m; ++i) {
            if (board[i][0] == "O") {
                dfs(board, i, 0);
                hasO = true;
            }
            if (board[i][n - 1] == "O") {
                dfs(board, i, n - 1);
                hasO = true;
            }
        }
        for (int j = 0; j < n; ++j) {
            if (board[0][j] == "O") {
                dfs(board, 0, j);
                hasO = true;
            }
            if (board[m - 1][j] == "O") {
                dfs(board, m - 1, j);
                hasO = true;
            }
        }
        if (!hasO) return new String[0][];
