            for (int j = 0; j < n; ++j) {
                if (board[i][j] == "*") continue;
                if (i > 0 && board[i-1][j]!= "*" && board[i-1][j] == "O") board[i][j] = "O";
                else if (j > 0 && board[i][j-1]!= "*" && board[i][j-1] == "O") board[i][j] = "O";
                else board[i][j] = "X";
            }
        }
