        if (x < 0 || x >= board.length || y < 0 || y >= board[0].length || board[x][y]!= "O") return;
        board[x][y] = "#";
        dfs(board, x + 1, y);
        dfs(board, x - 1, y);
        dfs(board, x, y + 1);
        dfs(board, x, y - 1);
    }
}

